def predict(triples: list[Triple]) -> str:
    sentence = ""
    subject_map = {}

    for triple in triples:
        subject = triple.subject
        predicate = triple.predicate
        object_ = triple.object

        if subject not in subject_map:
            subject_map[subject] = []
        subject_map[subject].append((predicate, object_))

    for subject, relations in subject_map.items():
        sentence += f"{subject} "
        relation_strings = []
        for predicate, object_ in relations:
            if predicate == "numberOfMembers":
                relation_strings.append(f"has {object_} members")
            elif predicate == "season":
                relation_strings.append(f"competed in the {object_} season")
            elif predicate == "league":
                relation_strings.append(f"plays in the {object_} league")
            elif predicate == "manager":
                relation_strings.append(f"is managed by {object_}")
            elif predicate == "ground":
                relation_strings.append(f"plays at {object_}")
            # Add other predicates here as needed
            else:
                relation_strings.append(f"is related to {object_} through {predicate}")

        sentence += " and ".join(relation_strings) + "."

    return sentence

